import React from 'react'
import {Link} from 'react-router-dom';
import "./Navigation.css";
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import {firebase} from "../../../base";
import { useHistory } from 'react-router';

const Navigation = ({Username,profileURL}) => {

    const history = useHistory();
    
    const signout = () => {
        firebase.auth().signOut();
        history.push('/home');
    }

    return (
        <nav className= "container">
            <Link className="left brandstyle" to="/">
                <div className="LogoWrapper">
                    {/* <img src="/images/logo.png" alt="logo"/> */}
                </div>
                <span>WTC-Realtime-ChatApp</span>
            </Link>
            
            <Link className= "right brandstyle" to="/">
                <div className="avatarWrapper">
                    <img className="avatarImage" src={`${profileURL}`} alt="avatar"/>
                </div>

                <span>{`${Username}`}</span>

                <ExitToAppIcon className="icon" onClick={signout}/>
                
            </Link>
            
        </nav> 
    )
}

export default Navigation
